import * as axs from './axs'; 


export const headSearchAction = (searchData, setLoading, setReply) => async (dispatch) =>{
    try{
        const{data}= await axs.headSearchApi(searchData);
        if(data.message === 'Success'){

            console.log(data);
            const {searchResult, message} = data;
            dispatch({type: 'HEAD_SEARCH', payload: searchResult});
            setLoading(false);

        } else if (data.message === 'NoTerm'){
            setLoading(false);
            setError('NoTerm');
        } 


    } catch(error){
        console.log(error);
    }
}
